import React from 'react'
import App from './App'

const Home = () => {
    let history = useHistory();

    function handleClick() {
        history.push("/home");
    }

  return (
    <div>
        <button onPress = { this.FunctionToOpenSecondActivity } title = 'Click Here To Open Second Activity'/>
    </div>
  )
}

export default Home
